svg.script:


	function SelectEvent(evt,event) {
	// Here the Polygon element is taken reverted to text and the "Poly" text is removed from ID name to ge the EventID
		var ActiveCircle = evt.target.id;
		var lengthCircle = ActiveCircle.length;
		var lengthIdEvent = lengthCircle - 6;
		var eventId = ActiveCircle.substr (0,lengthIdEvent);
		var ActivePoly = this.document.getElementById(eventId);
		var ArrayOfEvents = ["GLOBALED", "PROFESDEV", "GLOBALRES"];
		if (event == "mouseover")
		{ActivePoly.style.opacity = 0.2;
			for (var i = 0; i < ArrayOfEvents.length ; i++)
			{
					  var varCircleEvent = this.document.getElementById(ArrayOfEvents[i]);
					  if (varCircleEvent !== ActivePoly)
					  {varCircleEvent.style.opacity = 0;}


			}
	    }
	    else if (event == "mouseout")
	    {ActivePoly.style.opacity = 0;}
	}


    function EventClick(evt)
    {
    var wileylink = evt.target.id;
    if (wileylink == "GR") {
            window.location ="../GR.html";

      }
    else if (wileylink == "GE") {
     	       window.location = "../GE.html";
      }
    else if (wileylink == "PD") {
      	      window.location = "../PD.html";
      }

    }
